INSERT INTO `product` VALUES (1,42168,22,'Дверное полотно Лилия ПВХ','Полотно состоит из сосновой древесины и плиты МДФ. Каркас изготавливается из сращенных брусков, в него закладывается плита МДФ, фрезеруется и под вакуумным прессом наклеивается пленка ПВХ. Исполнение - стекло матовое.',2000.66,1,2,2,1,3),(2,14009,22,'Дверное полотно Камея','Каркас межкомнатных ламинированных дверей изготавливается из сращенного бруса древесины хвойных пород. Внутренее наполнение - сотовое. Облицовка - МДФ, ламинированное финиш пленкой. Исполнение - стекло матовое с фьюзингом.',2000.55,0,2,1,1,3),(3,133262,23,'Окно (дверь) металлопластиковое балконное белое Rehau Blitz, поворотно-откидное правое','Предназначено для установки в оконные проемы в квартирах, дачах и др.',10789.44,1,4,1,6,1),(4,26335,22,'Дверь металлическая модель 128 (левая)','Использование технологии двойного листа, толщина стали с наружной стороны 2,5 мм; 4 контура уплотнения; 5-ти канальная система запирания; сотовое наполнение двери; скрытые регулируемые петли; угол открывания 107-110 градусов; комплексная защита цилиндра \"Щит-2\"; фурнитура ML 300; цилиндр \"Masterlock\" 5+1+5 Антибампинг; дополнительный цилиндр; замок системы \"No key\" (без ключа); дополнительный сувальный замок(возможность замены на цилиндровый); возможна установка на улице, порошковое покрытие; оформление снаружи и внутри алюминиевыми молдингами; ',5789.4,1,1,4,2,4),(5,39959,22,'Дверь металлическая Лайн (левая)','Толщина стали 1,5 мм; наполнение двери - пенополистирол; открытие 180градусов; 2 цилиндровых замка \"DAF\" (Турция) - IV класса взломостойкости ',4579,1,2,5,2,5),(6,42560,22,'Дверь мет. модель \"ОПТИМА 2\" (левая)','Дверное полотно цельногнутое из стали толщиной 1,5 мм. Утеплитель \"Кнауф\". Общая толщина дверного полотна 67 мм. Толщина дверной коробки составляет 90 мм. Два контура уплотнителя. Петли наружные на подшипниках \"Апекс\". Снаружи полотно окращено полимерным покрытием \"Африка - цвет коричневый\". Внутри щит МДФ 8 мм в пленке ПВХ - венге светлый. Замки Кале (верхний - сувальдный, нижний - сложный цилиндр с поворотной ручкой ), ночная задвижка Апекс, ручки розетки (хром), броненакладка CRIT. Глазок широкоугольный в комплекте. ',8567,1,3,6,2,4),(7,41188,22,'Дверь металлическая модель С 328 (правая)','использование технологии двойного листа, толщина стали с наружной стороны 2,5 мм; 4 контура уплотнения; 5-ти канальная система запирания; сотовое наполнение двери; скрытые регулируемые петли; угол открывания 107-110 градусов; комплексная защита цилиндра \"Щит-2\"; фурнитура ML 300; цилиндр \"Masterlock\" 5+1+5 Антибампинг; дополнительный цилиндр; замок системы \"No key\" (без ключа); дополнительный сувальный замок(возможность замены на цилиндровый); возможна установка на улице, порошковое покрытие; оформление снаружи и внутри алюминиевыми молдингами; ',5600,0,1,7,2,5),(8,1,22,'Test','Test',123,1,2,1,2,2);
